column8:
　■かわいいデザイン、でも切れ味は本物です。<BR>
■切れ味が持続するモリブデンバナジウム鋼<BR>
■さびにくいステンレス製！クミーチェ包丁シリーズです。<BR>
■切った物が付きにくいディンプル(へこみ)付き<BR>
■すべりにくく手にフィットする持ちやすいハンドル<BR><br>
<img src="http://image.rakuten.co.jp/tokiwacamera/cabinet/tokiwacamera3/kumiche_houtyou.jpg"><BR><BR>
